import React, { useEffect, useState } from 'react';
const weatherAPI = {
  key: "8bd04b4c4bc8f493a35b227dba34ae78",
  baseURL: "http://api.weatherapi.com/v1",
}

function App() {

  let latitude = geolocationCoordinatesInstance.longitude
  let longitude = geolocationCoordinatesInstance.longitude

  const [currentLoc, setCurrentLoc] = useState({
    lat: 0,
    lon: 0,
  })

  useEffect(() => {
    setCurrentLoc({
      lat: latitude,
      lon: longitude
    })
  }, [])

  fetch(`https://api.openweathermap.org/data/2.5/weather?lat=35&lon=139&appid=${weatherAPI.key}`)
    .then(response => response.json())
    .then(data => console.log(data.weather[0].description));

  return (
    <div>
      <h1>Weather app</h1>
    </div>
  );
}

export default App;
